import operator

sequence = ""
k = 9
length = 566
t = 18

kmerDict = {}

# get unique k-mers in data string
for i in range(len(sequence)):
    if i == len(sequence) - k:
        break
    kmerDict[sequence[i:i+k]] = 0

for kmer in kmerDict.keys():
    count = 0

    for i in range(len(sequence)):
        if sequence[i:i+k] == kmer:
                count = count + 1
    
    kmerDict[kmer] = count

kmers = {}
kmersToSearch = []
kmerCounter = {}

for kmer in kmerDict.keys():
     if len(kmer) == k:
          if kmerDict[kmer] < t:
               continue
          #print(kmer)
          kmers[kmer] = 0
          kmersToSearch.append(kmer)
          kmerCounter[kmer] = 0

#print(*kmerCounter.items())

for i in range(len(sequence)):
    for j in range(length):

        for x in range(len(kmersToSearch)):
            if sequence[j + i : j + i + k] == kmersToSearch[x]:
                #print(sequence[j + i : j + i + k])
                kmerCounter[kmersToSearch[x]] += 1

        for kmer in kmerCounter.keys():
             if kmers[kmer] < kmerCounter[kmer]:
                  kmers[kmer] = kmerCounter[kmer]

        #print(*kmerCounter.items())

    for kmer in kmerCounter.keys():
             kmerCounter[kmer] = 0
    
    if (i + length) >= len(sequence):
            break
    
#print(*kmers.items())

for kmer in kmers.keys():
     #print(kmer)
     #print(kmers[kmer])
     if kmers[kmer] >= t:
          print(kmer, end=" ")